import React, { Component } from 'react';
import {InputGroup,InputGroupAddon,Input,InputGroupText, Button} from 'reactstrap';
import {motion,AnimatePresence} from 'framer-motion';
import {Link} from 'react-router-dom';

export default class createSession extends Component {
    constructor(props){}
      

    render() {
        return (
            <AnimatePresence>
            <motion.div className="session-page"  initial={{opacity:0}} animate={{opacity:1}} exit={{opacity:0}}>
                <InputGroup style={{width:"90%", margin:"0 auto"}}>
                    <Input placeholder="username"/>
                </InputGroup>
                <Link to="/lobby" exact>
                    <Button className="create-session-btn" color="primary">Create & Join</Button>
                </Link>
            </motion.div>
            </AnimatePresence>
        )
    }
}
